import React from "react";
import { Routes, Route } from 'react-router-dom';
import Layout from "./pages/Layout";
import Login from "./pages/Login";

//import { useRoutes } from "./routes";


const App = () => {

    //Se llama a esta funcion para obtener las rutas para luego iterar sobre la ruta com MAP y crear un componente para cada ruta

    return (

        <>
            <h1>Routes</h1>
            <Routes>

                <Route path="/SGU/Login" element={<Layout></Layout> }>

                </Route>

            </Routes>
            

        </>

    );

}

export default App;
